import React, { useState } from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import "./App.css";

function App() {
  const [city, setCity] = useState("");
  const [weather, setWeather] = useState(null);
  const [forecast, setForecast] = useState([]);
  const [loading, setLoading] = useState(false);
  const [darkMode, setDarkMode] = useState(false);

  const API_KEY = "YOUR_API_KEY"; // <-- replace with your OpenWeather key

  const fetchWeather = async (cityName) => {
    if (!cityName) return;
    setLoading(true);
    try {
      // Current weather
      const res = await fetch(
        `https://api.openweathermap.org/data/2.5/weather?q=${cityName}&appid=${API_KEY}&units=metric`
      );
      const data = await res.json();

      if (data.cod === 200) {
        setWeather(data);

        // Forecast (next 5 days, 3-hourly → filter daily at 12:00)
        const forecastRes = await fetch(
          `https://api.openweathermap.org/data/2.5/forecast?q=${cityName}&appid=${API_KEY}&units=metric`
        );
        const forecastData = await forecastRes.json();
        const daily = forecastData.list.filter((item) =>
          item.dt_txt.includes("12:00:00")
        );
        setForecast(daily.slice(0, 5));
      } else {
        setWeather(null);
        setForecast([]);
      }
    } catch (err) {
      console.error(err);
      setWeather(null);
      setForecast([]);
    }
    setLoading(false);
  };

  const handleSearch = () => {
    fetchWeather(city);
  };

  return (
    <div className={`app ${darkMode ? "dark-mode" : "light-mode"}`}>
      <Header />

      {/* Dark/Light toggle */}
      <div className="mode-toggle">
        <button onClick={() => setDarkMode(!darkMode)}>
          {darkMode ? "Switch to Light" : "Switch to Dark"}
        </button>
      </div>

      {/* Search bar */}
      <div className="search-bar">
        <input
          type="text"
          placeholder="Enter city..."
          value={city}
          onChange={(e) => setCity(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
      </div>

      {/* Loader */}
      {loading && <div className="loader"></div>}

      {/* Weather card */}
      {weather && !loading && (
        <div className="weather-card">
          <div className="city-name">{weather.name}, {weather.sys.country}</div>
          <div className="city-time">
            {new Date().toLocaleTimeString()}
          </div>

          <div className="temp">{Math.round(weather.main.temp)}°C</div>
          <div className="weather-desc">{weather.weather[0].description}</div>
          <div className="temp-feels">Feels like {Math.round(weather.main.feels_like)}°C</div>

          {/* Extra details */}
          <div className="details-grid">
            <div className="detail-card">
              <span>Min</span>{Math.round(weather.main.temp_min)}°C
            </div>
            <div className="detail-card">
              <span>Max</span>{Math.round(weather.main.temp_max)}°C
            </div>
            <div className="detail-card">
              <span>Humidity</span>{weather.main.humidity}%
            </div>
            <div className="detail-card">
              <span>Wind</span>{weather.wind.speed} m/s
            </div>
            <div className="detail-card">
              <span>Sunrise</span>
              {new Date(weather.sys.sunrise * 1000).toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })}
            </div>
            <div className="detail-card">
              <span>Sunset</span>
              {new Date(weather.sys.sunset * 1000).toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' })}
            </div>
          </div>
        </div>
      )}

      {/* Forecast */}
      {forecast.length > 0 && (
        <div className="forecast-section">
          {forecast.map((item, i) => (
            <div key={i} className="forecast-card">
              <span>{new Date(item.dt * 1000).toLocaleDateString([], { weekday: 'short' })}</span>
              <span>{Math.round(item.main.temp)}°C</span>
              <span>{item.weather[0].main}</span>
            </div>
          ))}
        </div>
      )}

      <Footer />
    </div>
  );
}

export default App;
